import logoutBtn from "../../images/power.png"

interface ProfileProps {
    username: string
    setUserName: (username: string | null) => void
}

function ProfileDropdown({username, setUserName}:ProfileProps) {
    return (
        <div className="profile-dropdown" data-testid="profile-dropdown">
            <p>{username}</p>
            <img src={logoutBtn} alt="Log out" onClick={() => setUserName(null)}/>
        </div>
  )
}

export default ProfileDropdown
